import React, {createContext} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


const Context = createContext(null)

ReactDOM.render(
  <React.StrictMode>
      <Context.Provider></Context.Provider>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
